[Form]
public class ITVTRentalLineOpenEndRental extends FormRun
{
    QueryFilter rentalToDateQueryFilter;
    InventDimCtrl_Frm_EditDimensions inventDimFormSetup;

}

/// <summary>
/// Gets inventory dimension group controller
/// </summary>
/// <returns>An instance of <c>InventDimCtrl_Frm_EditDimensions</c></returns>
public InventDimCtrl_Frm_EditDimensions inventDimSetupObject()
{
    return inventDimFormSetup;
}

    void updateDesign(InventDimFormDesignUpdate mode)
    {
        InventDimParm inventDimParmVisible;

        switch (mode)
        {
            case InventDimFormDesignUpdate::Init:
                if (!inventDimFormSetup)
                {
                    inventDimFormSetup = InventDimCtrl_Frm_EditDimensions::newFromForm(element);
                    inventDimFormSetup.parmSkipOnHandLookUp(true);
                    inventDimFormSetup.parmDimParmVisibleGrid(inventDimParmVisible);
                }
                break;

            case InventDimFormDesignUpdate::Active:
                inventDimFormSetup.formActiveSetup(InventDimGroupSetup::newItemId(ITVTRentalLine.ItemId));
                inventDimFormSetup.formSetControls(true);
                break;

            case InventDimFormDesignUpdate::FieldChange:
                inventDimFormSetup.formActiveSetup(InventDimGroupSetup::newItemId(ITVTRentalLine.ItemId));
                inventDim.clearNotSelectedDim(inventDimFormSetup.parmDimParmEnabled());
                inventDimFormSetup.formSetControls(true);
                break;

            default :
                throw error(strFmt("@SYS54195",funcName()));
        }
    }

        public void init()
        {
            super();

            QueryBuildDataSource qbdsITVTRentalLine = ITVTRentalLine_q.datasourceTable(tableNum(ITVTRentalLine));
            qbdsITVTRentalLine.addRange(fieldNum(ITVTRentalLine, PostedRentalFromDate)).value(SysQuery::valueNot(dateNull()));
            qbdsITVTRentalLine.addRange(fieldNum(ITVTRentalLine, PostedRentalToDate)).value(queryValue(dateNull()));
            
            rentalToDateQueryFilter = ITVTRentalLine_q.addQueryFilter(qbdsITVTRentalLine, fieldStr(ITVTRentalLine, RentalToDate));
        }

        public void executeQuery()
        {
            if (rentalToDateFilter.dateValue())
            {
                rentalToDateQueryFilter.value(SysQueryRangeUtil::lessThanDate(
                    rentalToDateFilter.dateValue() - DateTimeUtil::getToday(DateTimeUtil::getUserPreferredTimeZone()) + 1));
            }

            super();
        }

        public int active()
        {
            int ret;
        
            ret = super();

            element.updateDesign(InventDimFormDesignUpdate::Active);
        
            return ret;
        }

        public boolean modified()
        {
            boolean ret;
    
            ret = super();

            ITVTRentalLine_ds.executeQuery();
    
            return ret;
        }
